// components/AboutUs.js
import React from 'react';

const AboutUs = () => {
  return (
    <div>
      <h1>About CultuReach</h1>
      <p>
        CultureReach aims to connect users interested in different cultural activities with people that are hosting them.
        Users can search for events close to them, specific cultures, or specific events such as events related to dancing or food.
      </p>
      <p>
        We are committed to promoting cultural diversity and creating a platform where people can share and experience various cultural activities.
      </p>
    </div>
  );
};

export default AboutUs;
